import * as React from 'react';
import Toolbar from '@mui/material/Toolbar';
import Link from '@mui/material/Link';



function Hero() {
    return (
    <React.Fragment>
    <Toolbar
        component="nav"
        variant="dense"
        sx={{ justifyContent: 'space-between', overflowX: 'auto' }}
      >
          <Link
            color="inherit"
            noWrap
            variant="body2"
            sx={{ p: 1, flexShrink: 0 }}
          >
            Some content
          </Link>
            </Toolbar>
            </React.Fragment>
    )
}

export default Hero;
